import React from 'react';
import { Link } from 'react-router-dom';

const NavBar =()=>{
  return (
    <div>
      <Link to="/"></Link><p>Logo</p>
      <p>About</p>
      <p>Projects</p>
    </div>
  )
}

export default NavBar;
